import React from "react";
import styles from "./Roadmap.module.css";
import { RoadmapCard } from "../RoadmapCard/RoadmapCard";
import { useSelector } from "react-redux";
import Heading from "../../UI/Heading/Heading";

export const Roadmap = () => {
  const { roadmap } = useSelector((state) => state.suggestions);
  const statusList = ["planned", "in-progress", "live"];

  return (
    <section className={styles.roadmap}>
      <div className={styles.roadmap__status}>
        <div className={styles["roadmap__status_heading"]}>
          <Heading type="h3">Planned</Heading>
        </div>
      </div>

      {statusList.map((status) => {
        roadmap[status].map((data, i) => {
          <Roadmap key={i} {...data} />;
        });
      })}

      <div className={styles.roadmap__status}></div>
      <div className={styles.roadmap__status}></div>
    </section>
  );
};
